(21, 'Hoa Kỳ', '2025-03-27 00:46:05.481920', 'Trước bối cảnh hậu tận thế, chú mèo xám nhút nhát, vốn luôn sợ nước phải rời bỏ vùng an toàn khi căn nhà thân yêu bị cuốn trôi bởi cơn lũ dữ. Trên hành trình vượt đại dương mênh mông, chú mèo cùng những người bạn đồng hành (Capybara, chó Labrador Retriever, Vượn Cáo, chim Thư ký) phải học cách vượt qua nỗi sợ và chấp nhận những điểm khác biệt để cùng nhau tồn tại.', 88, 'Flow.jpg', 'Tiếng Anh', 'Flow.jpg', '2025-04-22 04:46:25.321270', '2025-03-07', 'PLAYING', 'Flow', 'https://www.youtube.com/watch?v=ZgZccxuj2RY');
